import React from 'react';

function Rodape(){
    return (
        <>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-12">
                        <div className="text-center"><h2> Formas de Pagamento: </h2></div>
                        <img src="./imagens/form pagamento.jpeg" alt="forma de pagamento" width="800" height="100" />
                    </div>
                </div>
            </div>
            
        </>
    )
}

export default Rodape;
